// filepath: /C:/Users/Subha/Desktop/recCal/calendar-app/frontend/src/components/User/CompanyCard.jsx
import React from 'react';

const CompanyCard = ({ company }) => {
    return (
        <div className="companyCard">
            <h3>{company.name}</h3>
            <p>{company.location}</p>
            <p>{company.email}</p>
            <p>{company.phoneNumbers.join(', ')}</p>
        </div>
    );
};

export default CompanyCard;
